import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar.js";
import Footer from "./components/Footer.js";
import Home from "./components/Home";
import Horoscope from "./components/Horoscope";
import Consult from "./components/Consult";
import AIChat from "./components/AIChat";
import Palmistry from "./components/Palmistry";
import Payment from "./components/Payment";
import LiveSessions from "./components/LiveSessions";
import About from "./components/About";
import Contact from "./components/Contact";
import Dashboard from "./components/Dashboard";
import TarotCard from "./components/TarotCard";
import EPooja from "./components/EPooja";
import GemStore from "./components/GemStore";

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/horoscope" element={<Horoscope />} />
        <Route path="/consult" element={<Consult />} />
        <Route path="/ai-chat" element={<AIChat />} />
        <Route path="/palmistry" element={<Palmistry />} />
        <Route path="/live-sessions" element={<LiveSessions />} />
        <Route path="/payment" element={<Payment />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/tarot-card" element={<TarotCard />} />
        <Route path="/e-pooja" element={<EPooja />} />
        <Route path="/gem-store" element={<GemStore />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
